import React, { useState } from 'react';

const InfoButton = () => {
	const [metaData, setMetaData] = useState(false);
	console.log(metaData);
	function showMetaData() {
		if (!metaData) {
			setMetaData(true);
		} else {
			setMetaData(false);
		}
	}

	return <button onClick={showMetaData}>+</button>;
};

export default InfoButton;
